==== 阿维斯陀文（Avestan） ====
阿维斯陀文目前的相关资料已经不可考证，它属于一种古老的印欧语言，属于伊朗语支的东伊朗语，阿维斯陀语亦是古波斯琐罗亚斯德教经典《阿维斯陀》成书时所用的一种古代波斯语，它在一定的程度上促进了古波斯文的发展。“阿维斯陀”一词与印度的“吠陀”相似，所以有人认为这是伊朗语族与印度语族相近的一个历史印证。

阿维斯陀语现时一般被归入东伊朗语支。这种语言跟西伊朗语族语言间的一个重要差别，在于阿维斯陀语有很丰富的元音，而且它同时保存了颚音和咝音。部份语言学家认为是一种印欧语开始分化（即咝音化）的现象，可以看到原来古印欧语丰富的颚音已开始简化，并开始出现咝辅音。但亦有语言学家认为这其实表明东伊朗语族和西伊朗语族本来就是不同的语种，而西伊朗语族更应该被归入闪含语系，而不是现在的印欧语系。对于这种现象，语言学家有不同的意见。这是因为东、西伊朗的分离，我们到现在还未有较深入的认识；另一方面，亦由于阿维斯陀语并没有演化成今日语言中的其中一种，而昔日的文本亦已残破不碪，使我们难以把它与今日伊朗诸语作比较，使它的分类不确定。

注意一点，阿维斯陀文的书写方向是从右至左。

