==== 欧甘字母（Ogham） ====
欧甘字母是古爱尔兰人用的一种文字，它是中世纪前期使用的字母系统，主要用来书写古威尔士语和有时候书写的布立吞亚支的语言。欧甘字母的传统把字母名称改为树木名称，因此又名“凯尔特语族树木字母表”。在爱尔兰和英国西部，约400个现存的以欧甘字母写成的石碑，其中大部分在爱尔兰南部的凱里郡至威尔士南部的戴伏德一带，其余的大多在爱尔兰的东西部、苏格兰西部、马恩岛和英格兰臨近的德文郡或康沃尔郡边境的地区，大部分碑文包含人名。“欧甘”一词来源不详，有可能来自古爱尔兰语“og-úaim”（由武器尖端造成的伤痕）。

