==== 科普特文【古埃及语】（Coptic）（ϯⲙⲉⲧⲣⲉⲙⲛ̀ⲭⲏⲙⲓ） ====
科普特语所使用的字母的字形源自希腊字母和世俗体字母，科普特语则是古埃及语言发展的最末阶段，属闪含语系，埃及-科普特语支。它是首个记录埃及語的字母文字，不同的科普特语方言和次方言的书写系统则采用不同的科普特字母。其次还有一点可以看得出来，科普特字母与希腊字母十分相近，因为当时的人们开始借鉴希腊字母，从而创造出科普特字母。

公元3世纪，出现大量用科普特语誊抄的希腊文献，尤其是基督教经文。卡尔西顿普教会后，亚历山大教团反对确立耶稣“一位二性”的信经，与罗马天主教分道扬镳，科普特语言文字在他们的使用中得到继承发扬。由此而来，他们也被称作“科普特（正）教派”。

